import Card from "Card";
function tours(tour){
    <div>
        <h1>
        Plan with Aryan
        </h1>
        <div>
            {
                tours.map( (tour) => {
                    return <Card {...tour}></Card>
                })

            }
        </div>
    </div>
}

export default tours;
